import React from 'react';
import Footer from './Footer';
import { Routes, Route, Outlet } from 'react-router-dom'
import Header from './Header';


function Container() {
    return (
        <div>
            <Routes>
                <Route path='/' element={<Header />} />
                <Outlet />
                <Footer />
            </Routes>
        </div>
    )
};

export default Container
